  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"types"}}>{`Types`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"factorygenerator"}}><MDXTag name="inlineCode" components={components} parentName="h2">{`FactoryGenerator`}</MDXTag></MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-ts"}}>{`type FactoryGenerator = (fake: Faker.FakerStatic) => IDataObject;
`}</MDXTag></MDXTag>
<MDXTag name="blockquote" components={components}>
<MDXTag name="p" components={components} parentName="blockquote">{`For more information on Faker.FakerStatic type refer to `}<MDXTag name="a" components={components} parentName="p" props={{"href":"https://www.npmjs.com/package/@types/faker"}}>{`https://www.npmjs.com/package/@types/faker`}</MDXTag></MDXTag>
</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"ifactoryobject"}}><MDXTag name="inlineCode" components={components} parentName="h2">{`IFactoryObject`}</MDXTag></MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-ts"}}>{`export interface IFactoryObject {
  create: (overrides?: IDataObject) => IDataObject;
  only: (keys: string | string[], overrides?: IDataObject) => IDataObject;
  make: (count?: number | IDataObject, overrides?: IDataObject) => IDataObject[];
  seed: (value: number) => IFactoryObject;
}
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"idataobject"}}><MDXTag name="inlineCode" components={components} parentName="h2">{`IDataObject`}</MDXTag></MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-ts"}}>{`export interface IDataObject {
  [key: string]: any;
}
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
